import logo from './logo.svg';
import './App.css';
import Navbar from './Components/Navbar';
import Splash from './Components/Splash';
import Contact from './Components/Contact';
import Footer from './Components/Footer';

function App() {
  return (
    <div>
      <div>
    <Navbar></Navbar>
    </div>
    <div>
    <Splash></Splash>
    </div>
    <div>
      <Footer></Footer>
    </div>
    <div>
      <Contact></Contact>
    </div>
    </div>
  );
}

export default App;
